import Link from "next/link";
import { MenuItem } from "./MenuItem";
const Navbar = () => {
  return (
    <nav className="navbarItems">
      <h1 className="navbarLogo"> navbar logo</h1>
      <div className="menuIcon">
        <ul>
          {MenuItem.map((item, index) => {
            return (
              <li key={index}>
                <Link href={item.page}>
                  <a>{item.title}</a>
                </Link>
              </li>
            );
          })}
        </ul>
      </div>
    </nav>
  );
};
export default Navbar;
